import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Recruiter from './Recruiter';
import BookmarkedFreelancer from './BookmarkedFreelancer/BookmarkedFreelancer';
import AddBookmarkFreelancer from './BookmarkedFreelancer/AddBookmarkFreelancer/AddBookmarkFreelancer';
import FindBookmarkFreelancerById from './BookmarkedFreelancer/FindBookmarkFreelancerById/FindBookmarkFreelancerById';
import ListBookmarks from './BookmarkedFreelancer/ListBookmarks/ListBookmarks';
import ListFreelancers from './BookmarkedFreelancer/ListFreelancers/ListFreelancers';
import Job from './Job/Job';
import AddJob from './Job/AddJob/AddJob';
import FindJobById from './Job/FindJobById/FindJobById';
import FindJobBySkill from './Job/FindJobBySkill/FindJobBySkill';
import ListAllJobs from './Job/ListAllJobs/ListAllJobs';
import AwardJob from './Job/AwardJob/AwardJob';
import ListApplicants from './Job/ListApplicants/ListApplicants';
import Feedback from './Feedback/Feedback';
import AddFeedback from './Feedback/AddFeedback/AddFeedback';

const RecruiterModule = () => {
  return (
    <Routes>
      <Route path="/recruiter" element={<Recruiter />} />
      <Route path="/recruiter/bmark/freelancer" element={<BookmarkedFreelancer />}>
        <Route path="listFreelancers" element={<ListFreelancers />} />
        <Route path="add" element={<AddBookmarkFreelancer />} />
        <Route path="find/:id" element={<FindBookmarkFreelancerById />} />
        <Route path="list" element={<ListBookmarks />} />
      </Route>
      <Route path="/recruiter/jobs" element={<Job />}>
        <Route path="create" element={<AddJob />} />
        <Route path="findSkill/:skill" element={<FindJobBySkill />} />
        <Route path="list" element={<ListAllJobs />} />
        <Route path="award/:jobId" element={<AwardJob />} />
        <Route path="viewApps/:jobId" element={<ListApplicants />} />
      </Route>
      <Route path="/recruiter/feedbacks/:frId" element={<Feedback />} />
      <Route path="/recruiter/feedbacks/add/:frUName" element={<AddFeedback />} />
    </Routes>
  );
};

export default RecruiterModule;
